# 3. 이름 한글만 뽑아내기
def names(name, df):
    p = df.dropna(subset=['출생일'])
    p = p.dropna(axis=1, thresh=800)

    id_list = list(p['_id'])
    if name == '한글':
        id_list = jalynne_tools.hangul_clear(id_list)

    elif name == '영어':
        id_list = jalynne_tools.eng_clear(id_list)

    else:
        print('name element should be 한글 or 영어')
    p['_id'] = id_list 
    return p

