hangul = re.compile('[^ ㄱ-ㅣ가-힣  ]+')

def religion(df):
    p = df
    p = p.dropna(axis=1, how='all')
    p = p.dropna(axis=1, thresh=800)
    
    # for1
    religion_list = list(p['종교'])
    
    result_list = jalynne_tools.parenthesis_clear(religion_list)
    # for2
    result_list1 = jalynne_tools.arrow_clear(result_list)
    
    religion_dic = jalynne_config.religion_dic
    
    # for3
    result_list2 = jalynne_tools.synonym_clear(result_list1, religion_dic)

    p['종교'] = result_list2

    return p

