import re

def party(df):
    p = df.dropna(subset=['출생일'])
    p = p.dropna(axis=1, how='all')
    p = p.dropna(axis=1, thresh=800)
    index_list3=list(p.index)

    # for1
    party_list = list(p['정당'])
    party_list = jalynne_tools.parenthesis_clear(party_list)
    party_list = jalynne_tools.arrow_clear(party_list)
    party_list = jalynne_tools.specialchar_clear(party_list)

    # for 4 학력 빈칸 다 없앰
    result_list4 = []
    for temp_index3 in index_list3:
        try:
            temp_data3 = p.loc[temp_index3, :]
            s = temp_data3['학력'].replace(" ", "")
            result_list4.append(s)
        except:
            result_list4.append(temp_data3['학력'])

    p['학력'] = result_list4

    # for 5 univ_list에 있는 univ이름 append하기
    index_list = list(univ_df.index)
    univ_list = []
    for temp_index in index_list:
        temp_data = univ_df.loc[temp_index, :]
        pp = temp_data['_id']
        univ_list.append(pp)

    final = []
    for b in list(p['학력']):
        flag = 0
        try:
            for a in univ_list:
                if a in b:
                    final.append(a)
                    flag = 1
                    break
                else:
                    pass
        except:
            pass

        if flag == 0:
            final.append('no result')

    p['학력'] = final

    return p

