# 7. 정당 정보만 가져오기
import re

def party_info(df):
    p = df.dropna(subset=['이념'])
    p = p.dropna(axis=1, how='all')
    p = p.dropna(axis=1, thresh=10)

    index_listp = list(p.index)
    
    
    virtue_list = list(p['이념'])
    virtue_list = jalynne_tools.parenthesis_clear(virtue_list)
    virtue_list = jalynne_tools.specialchar_clear(virtue_list)
    
    p['이념'] = virtue_list

    id_list = list(p['_id'])
    id_list = jalynne_tools.parenthesis_clear(id_list)
    id_list = jalynne_tools.hangul_clear(id_list)
    
    p['_id'] = id_list

    
    make_party_list = list(p['창당'])
    make_party_list = jalynne_tools.parenthesis_clear(make_party_list)
    
    p['창당'] = make_party_list

    spectrum_list = list(p['스펙트럼'])
    spectrum_list = jalynne_tools.parenthesis_clear(spectrum_list)
    
    p['스펙트럼'] = spectrum_list
    p['스펙트럼'] = p['스펙트럼'].fillna('no result')

    spectrum_dic = jalynne_config.sepctrum_dic
    

    p['스펙트럼'] = jalynne_tools.synonym_clear(list(p['스펙트럼']),spectrum_dic)

    # 상징색 괄호만 없앰
    result_list7 = []

    for temp_index6 in index_listp:
        try:
            temp_data6 = p.loc[temp_index6, :]
            g = temp_data6['상징색'].replace("[", "(").replace("]", ")").replace(" ", "").replace("-", ",").replace(
                "\n\xa0\xa0\xa0\xa0", ",").replace("\xa0\xa0\xa0\xa0", ",")
            g = re.sub(r'\([^)]*\)', '', g).replace(')', '').replace('(', '')
            result_list7.append(g)
        except:
            result_list7.append(g)

    p['상징색'] = result_list7

    result_list8 = []
    for temp_elem in list(p['창당']):
        try:
            if temp_elem.find('년') == -1:
                result_list8.append('no result')
                continue
            else: 
                temp_elem = temp_elem.replace(' ', '').strip()
                count = [i.start() for i in re.finditer('년', temp_elem)]
                temp_elem = temp_elem[max(0, count[len(count) - 1] - 5):count[len(count) - 1] + 8]

                hangul_numb = re.compile('[^가-힣 0-9]+')
                temp_elem = hangul_numb.sub('', temp_elem)

                str1_, str2_, str3_ = '', '', ''
                point1 = temp_elem.find('년')
                str1_ = temp_elem[:point1]
                if temp_elem.find('월') != -1:
                    point2 = temp_elem.find('월')
                    str2_ = temp_elem[point1 + 1:point2]
                    if temp_elem.find('일') != -1:
                        point3 = temp_elem.find('일')
                        str3_ = temp_elem[point2 + 1: point3]
                    else:
                        pass
                else:
                    pass

                if len(str2_) == 0:
                    result_list8.append(str1_)
                    continue
                elif len(str2_) == 1:
                    str2_ = '0' + str2_
                else:
                    pass

                if len(str3_) == 0:
                    result_list8.append(str1_ + str2_)
                    continue
                elif len(str3_) == 1:
                    str3_ = '0' + str3_
                else:
                    pass

                result_list8.append(str1_ + str2_ + str3_)



        except:
            result_list8.append('no result')

    p['창당'] = result_list8

    return p

