# 8 social event 함수로 만들기

def social_event(df):
    df = df.dropna(axis=1, how='all')
    events = ['대선', '올림픽', '월드컵', '아시안 게임']
    
    temp_list = []
    for b in tqdm(df.index):
        temp_data = df.loc[b, :].copy()

        values = []
        for key in temp_data.keys():
            if str(temp_data[key]) != 'nan':
                values.append(temp_data[key])
        flag = 0
        for e in events:
            for v in values:
                try:
                    v = v.replace(' ', '')
                    if e in v:
                        temp_list.append(b)
                        flag = 1
                        break
                    else:
                        pass
                except:
                    pass
            if flag == 1:
                break
            else:
                pass
    df = df.loc[temp_list, :]

    df = df.query('`개최 도시`.notnull() or 참가국.notnull() or 경력.notnull() or `참가 선수`.notnull() or 대회.notnull()')


    # [폐막식] 날짜정리
    
    closing_list1=list(df['폐막식'])
    closing_list1=jalynne_tools.date_8digits(closing_list1)
    closing_list1=jalynne_tools.date_clear(closing_list1)
    
    df['폐막식'] = closing_list1

    # [개회식] 날짜정리

    opening_list=list(df['개회식'])
    opening_list=jalynne_tools.date_8digits(opening_list)
    opening_list=jalynne_tools.date_clear(opening_list)
    
    df['개회식'] = opening_list


    # [폐회식] 날짜정리

    closing_list2=list(df['폐회식'])
    closing_list2=jalynne_tools.date_8digits(closing_list2)
    closing_list2=jalynne_tools.date_clear(closing_list2)    

    df['폐회식'] = closing_list2
    
    return df

